How to store original date/time without timezone calculation to MongoDb<p>I'm getting a list of some events in a different locations from providers  with events date/time (events are in different timezones, so the dates/time are always local). I need to save it to the mongodb as I got them, but it looks like Mongo is converting it using my local timezone, so instead of event that starts at 20:00 i got 18:00 saved in the database. </p>

<p>I'm using java spring boot app and when I try to filter results, if i select events after 19:00, my event is not in a list, but it should be there. I would like to store those dates without calculating timezone. Is there any way to configure mongo not to do the calculation? I'm using mongodb driver version 3.9.0.</p>

<p>Update (time field definition):</p>

<pre><code>@Temporal(TemporalType.TIMESTAMP)
@Field("time")
private LocalDateTime time;
</code></pre>

<p>Update 2:
I played with shell and when I insert something like:</p>

<pre><code>var mydate2 = ISODate();
db.test.insertOne( { iso: mydate2 } );
</code></pre>

<p>the result is:</p>

<pre><code>{ "_id" : ObjectId("5d5173dc6240209d9377677a"), "iso" : ISODate("2019-08-12T14:12:42.762Z") }
</code></pre>

<p>but when I insert Date instead:</p>

<pre><code>var mydate2 = Date();
db.test.insertOne( { iso: mydate2 } );
</code></pre>

<p>the result is:</p>

<pre><code>{ "_id" : ObjectId("5d51741b6240209d9377677b"), "iso" : "Mon Aug 12 2019 16:13:42 GMT+0200 (Central Europe Standard Time)" }
</code></pre>

<p>, so the correct one. 
Can I somehow say from Spring document definition that I want to use Date? Should I use ZonedDateTime instead of LocalDateTime?</p>

