Aggregation to combine collections attempt<p>I want to perform an aggregation in Java: here's my attempt</p>

<p><strong>Example of dept collection.</strong></p>

<pre><code>{
    "_id" : ObjectId("5d4dc8635dd32dbcba4ae0ae"),
    "name" : "Sales"
}
</code></pre>

<p><strong>Example of employee_dept collection</strong></p>

<pre><code>{
    "_id" : ObjectId("5d5411be6cd7524f36a7933f"),
    "dept_id" : ObjectId("5d4dc8635dd32dbcba4ae0ae"),
    "employee_id" : ObjectId("5d4dc8635dd32dbcba4ae0af")
}
</code></pre>

<p><strong>Example of output expected</strong></p>

<pre><code>{
    "_id" :"5d4dc8635dd32dbcba4ae0ae",
    "name" : "Sales"
}
</code></pre>

<p><strong>Java code</strong></p>

<pre><code>DBObject match = new BasicDBObject("$match", new BasicDBObject("employee_id", "5d4dc8635dd32dbcba4ae0af"));

// build the $lookup operations
DBObject lookupFields = new BasicDBObject("from", "dept");
lookupFields.put("localField", "dept_id");
lookupFields.put("foreignField", "_id");
lookupFields.put("as", "dept");
DBObject lookup = new BasicDBObject("$lookup", lookupFields);

// build the $projection operations
DBObject projectFields = new BasicDBObject("name", 1);
projectFields.put("_id", 1);
DBObject project = new BasicDBObject("$project", projectFields);

List&lt;DBObject&gt; pipeline = Arrays.asList(match, lookup, project);

AggregateIterable aggregateIterable = dbCollection.aggregate(pipeline);

for(Object result: aggregateIterable) {
    System.out.println(result);
}
</code></pre>

<p><strong>Issue:</strong> aggregateIterable is not getting output due to some reason</p>

<p>B) if you don't mind adding how to project for $employee_dept._id and employee_id within the following? </p>

<pre><code>Document project = new Document("$project", new BasicDBObject("name", "$dept.name")
            .append("e_id", "$employee_department._id")
            .append("employee_id", "$employee_department.employee_id")
