How to define a new field in a pre-existing document in MongoDB that isn't in the schema? (Node.js)<p>I am making a discord bot using MongoDB and I want to add some user-specific fields to an already existing document in MongoDB that aren't in the schema. There is a lot of data I am planning to add and I wanted it to be added automatically depending on what the user does for efficiency.</p>

<p>I tried to use findOneAndUpdate to set the new field and its value. I had the settings "strict" set to false and "upsert" set to true. I saved it afterwards. I did see that it was added in the Compass Community App, but when I tried to call the field later, it was undefined and I'm assuming because it isn't in the schema. I wanted to know if there was a way around this or if I made any errors.</p>

<pre><code>Users.findOneAndUpdate({
  userID: message.author.id
}, {
  $set: {
    "xp": xpToBeAdded,
    "level": 0
   }
}, {
  strict: false,
  upsert: true
}, async (err, userAdd) =&gt; {
  await userAdd.save().catch(err =&gt; console.log(err))
})
</code></pre>

<p>Original users schema:</p>

<pre><code>const mongoose = require("mongoose");

const userSchema = mongoose.Schema({
    userID: String,
    serverID: Array,
    userTag: String,
    username: String,
    dbCreatedAt: Number,
    dbCreatedAtDate: String
}, {strict: false})

module.exports = mongoose.model("User", userSchema)
</code></pre>

