ReferenceError when using MongoDB Collection variable in external resolver file that was imported via mergeResolvers<p>This is a totally reduced example to better explain the issue! So when I use the <strong>resolver Query</strong> <code>getAllUsers</code>, the <strong>MongoDB Collection</strong> <code>Users</code> is not available in the external resolver file <code>user.js</code>. So when I send that query I get: </p>

<blockquote>
  <p>ReferenceError: Users is not defined</p>
</blockquote>

<p>That's a correct behaviour. But I do not want to include all the resolvers in my index.js, because I have a better modularization in this way. So I have all my typedefs and resolvers in external files like this.</p>

<h2>Current file structure</h2>

<pre><code>index.js 
  /graphql
    /typdef
      user.graphql
    /resolver
      user.js
</code></pre>

<p>The <code>user.graphql</code> schema is correctly working. It is just the <code>user.js</code> that is producing the error when I execute the query with the not available <code>Users</code> variable, as already said.</p>

<p>Here the <code>index.js</code> and <code>user.js</code>.</p>

<h2>index.js</h2>

<pre><code>import express from 'express'
import cors from 'cors'
const app = express()
app.use(cors())
import bodyParser from 'body-parser'
import {graphqlExpress, graphiqlExpress} from 'graphql-server-express'
import {makeExecutableSchema} from 'graphql-tools'
import {fileLoader, mergeTypes, mergeResolvers} from 'merge-graphql-schemas';
import {writeFileSync} from 'fs'
const typeDefs = mergeTypes(fileLoader(`${__dirname}/graphql/typedef/*.graphql`), { all: true })
writeFileSync(`${__dirname}/graphql/typedef.graphql`, typeDefs)

export const start = async () =&gt; {
  try {
    const MONGO_URL = 'mongodb://localhost:27017'
    const MongoClient = require('mongodb').MongoClient;
    MongoClient.connect(MONGO_URL, function(err, client) {
      console.log("Connected successfully to server");
      const db = client.db('project');
      const Users = db.collection('user')
    });
    const URL = 'http://localhost'
    const homePath = '/graphql'
    const PORT = 3001
    app.use(
      homePath, 
      bodyParser.json(), 
      graphqlExpress({schema})
      )
    app.use(homePath, 
      graphiqlExpress({
        endpointURL: homePath
      })
    )
    app.listen(PORT, () =&gt; {
      console.log(`Visit ${URL}:${PORT}${homePath}`)
    })
  } catch (e) {
    console.log(e)
  }
}
</code></pre>

<h2>user.js</h2>

<pre><code>export default {
  Query: {
    getAllUsers: async () =&gt; {
    return (await Users.find({}).toArray()).map(prepare)
    }
  }
}
</code></pre>

<p>What is the best way to pass the MongoDB or the <code>Users</code> collection to the resolver files. Or is there an even better solution for this issue?</p>

