Can we create an index on a Switch... Case in MongoDB<p>I have a HUGE collection. I am using <code>match</code> to do a filter on values I set by <code>CASE</code> statement. Can I create an index on that text value?</p>

<p>This is my Query:</p>

<pre><code>db.col.aggregate([
{
    '$match': {
        'date': {
            '$gte': '2019-07-15',
            '$lte': '2019-08-14'
        },
        'xyz': 'abc'
        },
    },
{
    '$group': {
        '_id': {
            'b_version': '$b',
        'b_main':
                    {'$switch': {
                        'branches': [
                            { 'case': {'$gt': [{'$indexOfCP': ['$b', "Google Plus"]} ,-1]}, 'then': 'GP' },
                            { 'case': {'$gt': [{'$indexOfCP': ['$b', "Facebook"]} ,-1]}, 'then': 'FB' },
                            { 'case': {'$gt': [{'$indexOfCP': ['$b', "Instagram"]} ,-1]}, 'then': 'IG' },
                            { 'case': {'$gt': [{'$indexOfCP': ['$b', "Snapchat"]} ,-1]}, 'then': 'SC' },
                        ],
                            'default': 'Other'
                    }
                },
        },
        'b_ct': {'$sum': 1},
        'starts': {'$sum': '$starts'},
        'completes': {'$sum': '$completes'}

}
}, {
    '$project': {
        '_id': 0,
        'b_version': '$_id.b_version',
        'b_main': '$_id.b_main',
        'b_ct': '$b_ct',
        'starts': '$starts',
        'completes': '$completes',
    }
}, {'$match': {'b_main': 'SC'}},
{ '$sort': { 'b_main': 1, 'b_version': 1}, }
])
</code></pre>

<p>I want to set an <code>index</code> on <code>b_main</code>. Is there a way to do that? I actually want to set it on <code>date, xyz and a text match on b_main</code></p>

<p>Is is possible to do that?</p>

