    emp2.put("website", "webcodegeeks.com");

    Document emp2_addr = new Document();
    emp2_addr.put("addr_line1", "Fremont, AK USA");
    emp2_addr.put("zip_code", "19408");
    emp2.put("address", emp2_addr);
</code></pre>

<p>Filtration</p>

<pre><code>            documents = collection.aggregate(Arrays.asList(
                    Aggregates.match(eq("address.zip_code", "19408")),
                    Aggregates.match(Filters.eq("address.addr_line1", "USA"))));       
            listDoc = new ArrayList&lt;&gt;();
            for (Document doc : documents) {
                listDoc.add(doc);
            }
            System.out.println(Arrays.toString(listDoc.toArray()));
</code></pre>; Answer: No, that doesn't apply when you output with `--oformat binary`, the entry point you specify would have applied if you were outputting a normal _ELF_ executable. Outputting with binary (without a linker script) will force _LD_ to process things in order they appear. Likely the code for `os.o` got placed first in your binary image followed by `third_stage.o`. So the code loaded at 0x100000 was likely not what you were expecting.
